// src/App.js
import React from 'react';
import './App.css';
import Booklist from './components/Booklist/Booklist';
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";
import BookDetails from './components/details/BookDetails';


const App = createBrowserRouter([
  {
    path: "/",
    element: (
      <div className="App">
        <Booklist />
      </div>
    ),
  },

  {
    path: "/:id",
    element: (
      <div className="App">
        <BookDetails />
      </div>
    ),
  },

]);

export default App;
